import React, { useState } from "react";
import '../App.css';
import axios from "axios";


const AutoCompleteResults = ({autocomplete}) => {

    const [temp, setTemp] = useState(0)

    const sendCoordinates = (term) => {

        const toSend = {
            name: term
        }
        console.log(toSend);
        axios
            .post('http://localhost:3001/coords', toSend)
            .then(response => {
                console.log(response)
                setTemp(response.data.hourly.length)
            })
            .catch(error => console.log(error))


    }

    return (
        <>
          {autocomplete.map((term, idx) => (
            <div className="autocompleteTerm" onClick={() => sendCoordinates(term)}>{term}</div>
          ))}
          <h3>{temp}</h3>
        </>
    )
}

export default AutoCompleteResults;
